// src/components/AnalysisPage.jsx (important parts)
import React, { useState, useEffect, useRef } from 'react';
import { useParams, useLocation, useNavigate } from 'react-router-dom';
import { useAuth } from '../auth/AuthProvider';
import axios from 'axios';

export default function AnalysisPage() {
  const { analysisType } = useParams();
  const auth = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  const [file, setFile] = useState(null);
  const [columns, setColumns] = useState([]);
  const [loading, setLoading] = useState(false);
  const fileRef = useRef();

  useEffect(() => {
    // If we arrive with a pendingUploadKey (after login), attempt to restore & auto-upload
    const pendingKey = location.state?.pendingUploadKey;
    if (pendingKey) {
      const raw = sessionStorage.getItem(pendingKey);
      if (raw) {
        try {
          const payload = JSON.parse(raw); // { name, type, dataUrl }
          // reconstruct File/Blob from dataURL and auto-upload
          dataURLToFile(payload.dataUrl, payload.name, payload.type)
            .then((restoredFile) => {
              setFile(restoredFile);
              // Auto-start upload
              onUploadInternal(restoredFile);
              // cleanup key from sessionStorage (optional)
              sessionStorage.removeItem(pendingKey);
              // remove state so it doesn't try again on refresh
              navigate(location.pathname, { replace: true, state: {} });
            })
            .catch((err) => console.error('restore failed', err));
        } catch (err) {
          console.error('invalid pending upload payload', err);
        }
      }
    }
  // we only want to run this when the component mounts or location.state changes
  // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [location.state]);

  // helper: convert dataURL back to File
  function dataURLToFile(dataUrl, filename, mimeType) {
    return fetch(dataUrl)
      .then(res => res.blob())
      .then(blob => new File([blob], filename, { type: mimeType || blob.type }));
  }

  // helper: actual upload to backend
  async function uploadToBackend(fileToUpload) {
    const fd = new FormData();
    fd.append('file', fileToUpload);
    fd.append('analysisType', analysisType);
    // add other fields as required
    const { data } = await axios.post('http://localhost:5000/api/upload', fd, {
      headers: { Authorization: auth.token ? `Bearer ${auth.token}` : undefined }
    });
    return data;
  }

  // internal upload routine used both for auto-restore and normal upload
  async function onUploadInternal(fileToUpload) {
    setLoading(true);
    try {
      const response = await uploadToBackend(fileToUpload);
      // handle backend response: show columns/reports etc.
      setColumns(response.columns || []);
      // optionally navigate to results page
    } catch (err) {
      console.error(err);
      alert('Upload failed: ' + (err.response?.data?.message || err.message));
    } finally {
      setLoading(false);
    }
  }

  // called when user clicks the 'Upload & Analyze' button
  const onAnalyze = async (e) => {
    e.preventDefault();
    if (!file) {
      alert('Please choose a file first');
      return;
    }

    // If user authenticated -> normal upload
    if (auth.user) {
      await onUploadInternal(file);
      return;
    }

    // --- NOT AUTHENTICATED: save file temporarily, then redirect to login ---
    try {
      // read file into dataURL (so we can restore later)
      const reader = new FileReader();
      reader.onload = () => {
        const dataUrl = reader.result; // base64 string
        const pendingKey = `pending_upload_${Date.now()}`;
        const payload = {
          name: file.name,
          type: file.type,
          size: file.size,
          dataUrl
        };
        // store in sessionStorage (cleared when tab is closed)
        try {
          sessionStorage.setItem(pendingKey, JSON.stringify(payload));
        } catch (err) {
          console.error('sessionStorage full or unavailable', err);
          alert('Unable to save file for resume. Please sign in first or try a smaller file.');
          return;
        }

        // navigate to login and remember where to return
        navigate('/login', { state: { from: location, pendingUploadKey: pendingKey } });
      };

      reader.onerror = (err) => {
        console.error('file read failed', err);
        alert('Failed to read file. Try again.');
      };

      reader.readAsDataURL(file);
    } catch (err) {
      console.error('onAnalyze failed', err);
      alert('Unexpected error. Try again.');
    }
  };

  return (
    <div className="pf-page">
      <div className="pf-card">
        <h2>{analysisType?.replace('-', ' ')}</h2>

        <form onSubmit={onAnalyze}>
          <input
            ref={fileRef}
            type="file"
            accept=".csv,.xlsx"
            onChange={(e) => setFile(e.target.files[0])}
          />
          <button className="pf-primary" type="submit" disabled={loading}>
            {loading ? 'Processing...' : 'Upload & Analyze'}
          </button>
        </form>

        {/* show detected columns or upload status */}
        {columns.length > 0 && (
          <div className="pf-panel">
            <h4>Detected columns</h4>
            <div className="pf-tags">{columns.map(c => <span key={c} className="pf-tag">{c}</span>)}</div>
          </div>
        )}
      </div>
    </div>
  );
}
